import React, { useState, useEffect, useCallback } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { FiHome, FiSearch, FiMail, FiInfo, FiLogIn, FiUser, FiSettings, FiLogOut } from 'react-icons/fi';
import { useAuth } from '../contexts/AuthContext';
import '../styles/Navbar.css';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [isMobile, setIsMobile] = useState(false);
  const location = useLocation();
  const { user, logout, isAuthenticated } = useAuth();

  // Check if device is mobile
  const checkMobile = useCallback(() => {
    setIsMobile(window.innerWidth <= 991);
  }, []);

  // Set active link based on current path
  const getActiveLink = () => {
    const path = location.pathname;
    if (path === '/' || path === '/home') return 'home';
    if (path === '/properties') return 'buy';
    if (path === '/rent') return 'rent';
    if (path === '/about') return 'about';
    if (path === '/contact') return 'contact';
    return '';
  };

  const activeLink = getActiveLink();

  // Handle scroll effect
  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 10);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  // Handle window resize
  useEffect(() => {
    checkMobile();
    
    const handleResize = () => {
      checkMobile();
      // Close mobile menu when switching to desktop
      if (window.innerWidth > 991 && isMenuOpen) {
        setIsMenuOpen(false);
      }
    };

    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, [checkMobile, isMenuOpen]);

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);
  const closeMenu = () => setIsMenuOpen(false);

  const handleHomeClick = () => {
    closeMenu();
    window.scrollTo({
      top: 0,
      behavior: 'smooth'
    });
  };

  const toggleDropdown = () => {
    if (isMobile) {
      setIsDropdownOpen(!isDropdownOpen);
    }
  };

  const handleLogout = () => {
    logout();
    setIsDropdownOpen(false);
    closeMenu();
  };

  // Click outside handlers
  useEffect(() => {
    const handleClickOutside = (event) => {
      // Close mobile menu
      if (isMenuOpen && 
          !event.target.closest('.navbar-links') && 
          !event.target.closest('.menu-toggle')) {
        setIsMenuOpen(false);
      }
      
      // Close dropdown (only for desktop)
      if (!isMobile && isDropdownOpen && 
          !event.target.closest('.navbar-user')) {
        setIsDropdownOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, [isMenuOpen, isDropdownOpen, isMobile]);

  // Handle body overflow for mobile menu
  useEffect(() => {
    if (isMenuOpen && isMobile) {
      document.body.style.overflow = 'hidden';
    } else {
      document.body.style.overflow = 'auto';
    }
    return () => {
      document.body.style.overflow = 'auto';
    };
  }, [isMenuOpen, isMobile]);

  // Close menu on route change
  useEffect(() => {
    setIsMenuOpen(false);
    setIsDropdownOpen(false);
  }, [location.pathname]);

  // Get username from email
  const getUserName = () => {
    if (!user || !user.email) return '';
    const emailParts = user.email.split('@');
    return emailParts[0];
  };

  // Handle keyboard navigation
  const handleKeyDown = (event) => {
    if (event.key === 'Escape') {
      setIsMenuOpen(false);
      setIsDropdownOpen(false);
    }
  };

  useEffect(() => {
    document.addEventListener('keydown', handleKeyDown);
    return () => document.removeEventListener('keydown', handleKeyDown);
  }, []);

  return (
    <nav className={`navbar ${scrolled ? 'scrolled' : ''}`}>
      <div className="navbar-content">
        <div className="navbar-logo">
          <Link to="/" onClick={handleHomeClick}>
            <span className="navbar-logo-icon" aria-hidden="true"></span>
            Chalets Suisses
          </Link>
        </div>

        <button 
          className={`menu-toggle ${isMenuOpen ? 'active' : ''}`} 
          onClick={toggleMenu}
          aria-label={isMenuOpen ? 'Close menu' : 'Open menu'}
          aria-expanded={isMenuOpen}
          aria-controls="navbar-menu"
        >
          <span></span>
          <span></span>
          <span></span>
        </button>

        <ul 
          id="navbar-menu"
          className={`navbar-links ${isMenuOpen ? 'active' : ''}`}
          role="navigation"
          aria-label="Main navigation"
        >
          <li>
            <Link 
              to="/" 
              className={activeLink === 'home' ? 'active' : ''} 
              onClick={handleHomeClick}
              aria-label="Go to home page"
            >
              <FiHome aria-hidden="true" /> 
              <span>Home</span>
            </Link>
          </li>
          <li>
            <Link 
              to="/properties" 
              className={activeLink === 'buy' ? 'active' : ''} 
              onClick={closeMenu}
              aria-label="Browse chalets for sale"
            >
              <FiSearch aria-hidden="true" /> 
              <span>Buy Chalets</span>         
            </Link>
          </li>
          <li>
            <Link 
              to="/coming-soon" 
              onClick={closeMenu}
              aria-label="Get price estimate"
            >
              <FiSearch aria-hidden="true" /> 
              <span>Price Estimate</span>
            </Link>
          </li>
          <li>
            <Link 
              to="/contact" 
              className={activeLink === 'contact' ? 'active' : ''} 
              onClick={closeMenu}
              aria-label="Contact us"
            >
              <FiMail aria-hidden="true" /> 
              <span>Contact Us</span>
            </Link>
          </li>

          {isAuthenticated ? (
            <div 
              className="navbar-user" 
              onClick={toggleDropdown}
              role="button"
              tabIndex={0}
              aria-label={`User menu for ${getUserName()}`}
              aria-expanded={isDropdownOpen}
              onKeyDown={(e) => {
                if (e.key === 'Enter' || e.key === ' ') {
                  e.preventDefault();
                  toggleDropdown();
                }
              }}
            >
              <FiUser aria-hidden="true" />
              <span className="username">{getUserName()}</span>
              {(isDropdownOpen || !isMobile) && (
                <div 
                  className="dropdown-menu"
                  role="menu"
                  aria-label="User account options"
                >
                  {user.is_admin ? (
                    <Link 
                      to="/admin-dashboard" 
                      onClick={() => {
                        setIsDropdownOpen(false);
                        closeMenu();
                      }}
                      role="menuitem"
                    >
                      <FiSettings aria-hidden="true" /> Admin Dashboard
                    </Link>
                  ) : (
                    <Link 
                      to="/user-dashboard" 
                      onClick={() => {
                        setIsDropdownOpen(false);
                        closeMenu();
                      }}
                      role="menuitem"
                    >
                      <FiSettings aria-hidden="true" /> My Dashboard
                    </Link>
                  )}
                  <button 
                    onClick={handleLogout}
                    role="menuitem"
                    aria-label="Sign out of your account"
                  >
                    <FiLogOut aria-hidden="true" /> Log out
                  </button>
                </div>
              )}
            </div>
          ) : (
            <div className="navbar-auth">
              <Link 
                to="/login" 
                className="login-btn" 
                onClick={closeMenu}
                aria-label="Login or sign up"
              >
                <FiLogIn aria-hidden="true" /> 
                <span>Login / Sign Up</span>
              </Link>
            </div>
          )}
        </ul>

        {/* Overlay for mobile menu */}
        {isMenuOpen && isMobile && (
          <div 
            className="navbar-overlay" 
            onClick={closeMenu}
            aria-hidden="true"
            style={{
              position: 'fixed',
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              backgroundColor: 'rgba(0, 0, 0, 0.5)',
              zIndex: 999,
            }}
          />
        )}
      </div>
    </nav>
  );
};

export default Navbar;
